export default function GetLastPlayData(data) {

    const playerDetail = (data) => {
        const query = data.pstsg;
        console.log('query');
        console.log(query);
    }

    const lastPlayData = {
        'clock': data.lpla.cl,
        'teamID': data.lpla.tid,
        'playerID': data.lpla.pid,
        'eventType': data.lpla.etype,
        'event': data.lpla.evt,
        'description': data.lpla.de,
    };

    return lastPlayData;
}
